  false,\n\t\"url\": null,\n\t\"notes\": \"The Southeast Fishery-Independent Survey
  (SEFIS) was created by the National Marine Fisheries Service in 2010 and operates
  out of the NOAA Beaufort Laboratory. The survey conducts fishery-independent sampling
  and related applied research, focusing on the assessment of spatial variability
  in distribution and abundance of marine fish species within the snapper-grouper
  complex, via data collected from fish traps, video cameras, and acoustic gears.
  \ The NOAA ship Pisces departed Morehead City, NC on 24 July 2012 for a SEFIS research
  cruise in continental shelf and shelf-break waters off the southeastern U.S.  During
  this survey, 385 sq km of multibeam data were collected from 29 discrete areas in
  the sea area of Raleigh Bay, NC.  A total of 328 concomitant trap-camera samples
  were collected. During PC1204, Caris multibeam processing methods were used at sea
  for the first time.  SEFIS program website:nhttp://www.sefsc.noaa.gov/labs/beaufort/ecosystems/sefis/\",\n\t\"license_title\":
